import './App.css';
import CalCard from './card.jsx';

function App(props) {
  return (
    <div className="App">
    <h1>Umang's Calorie Chart this week</h1>
    <div className="cal-app-container">
      <CalCard title='Pizza' calorie='56' />
      <CalCard title='Burger' calorie='69'/>
      <CalCard title='Coke'calorie='500'/>
      <CalCard title='Brownie'calorie='180' />
      <CalCard title='Fried Rice'calorie='90'/>
      <CalCard title='Lassania'calorie='200'/>
      <CalCard title='Pani Puri'calorie='10'/>
      </div>
    </div>
  );
}

export default App;
